import React, { Component } from 'react';
import eduimage from '../img/edu.png';
class Edu extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <section className="educationsection">
            <div>
            <div className="serviceheader">
                    <h1 className="text-center" id="servicehead"> Education</h1>
                    <div className="underlineedu text-center"></div>
                    </div>
                    <div className="container">
                        <div className="row">
                            
                        <div className="col-md-4">
                                <div className="eduimage">
                                    <img src={eduimage} id="edui" alt="educationimage"/>
                                </div>
                            </div>
                        <div className="col-md-8">
                            <div className=" schoolname">
                                <li className="justify-text">SCL at Shree Nuwar Subedi Thar Higher Secondary School, Kushma municipality 01 pang</li>
                                <li className="justify-text">+2 at Shree Himalaya Higher Secondary School, kushma municipality 02 Khurto</li>
                                <li className="justify-text">Information Technology2 at Internation School of management & technology,Kaski Pokhara </li>
                            </div>
                            </div>

                           </div>
                    </div>
                </div>
                </section>
        );
    }
}



export default Edu;
